import { Typography, TextField, Grid, Stack, TextareaAutosize, useMediaQuery, Button, Alert } from '@mui/material';
import React, { useState } from 'react';
import PhoneInput from "react-phone-input-2";
import '../App.css';
import 'react-phone-input-2/lib/style.css'
import { useTranslation } from 'react-i18next';

export default function PersonalInfo({name,setName,gender,selectedGender,setselectedGender,phone,
    setPhone,birthday,setBirthday,email,setEmail,lastName,setLastName}){

    const { t } = useTranslation();
  return (
    <div>
         <Grid>
            <TextField
              label={t("First Name")}
              value={name}
              onChange={(e) => { setName(e.target.value) }}
              InputLabelProps={{
                sx: {
                  color: 'white'
                }
              }}
              sx={{borderRadius:'5px', width: '300px', border: '1px solid white',
              '&:focus': { border: '1px solid white' },'.MuiInputBase-input':{color:"white"} }}
            />
          </Grid>
    </div>
  )
}
